PROPERTIES.Text:
var fenetreTPG = null;
function ouvreFenetreTPG(nom,titre,url) {
	//On donne toujours le même nom à la fenêtre pour réutiliser toujours la même fenêtre.
	fenetreTPG = window.open(url + '','TPG');
	fenetreTPG.focus();
}
if (sessionStorage.getItem(printscreen.ITEM_NAME_IN_CTX)) {
	sessionStorage.removeItem(printscreen.ITEM_NAME_IN_CTX);
	sessionStorage.removeItem(printscreen.SCENARIO_ITEM_NAME_IN_CTX);
}

$(function() {
	cgEvent.trigger($(window), cgEvent.CONTAINER_VISIBLE);
});

